<template>
    <div id="frozeneon-test-task">
        <div class="search">
            <input 
                ref="input"
                type="text" 
                placeholder="Search"
                class="search__input"
                v-model="search"
            />
        
            <div class="dropdown search__dropdown">
                <template v-if="!loading">
                    <div 
                        v-for="card in result"
                        :key="card.id"
                        class="card dropdown__card"
                        @click.stop="selectItem(card)"
                    >
                        <div class="card__image">
                            <img :src="card.thumbnail" alt="">
                        </div>
                        <div class="card__text">
                            <div class="card__title">
                                {{ card.title }}
                            </div>
                            <div class="card__description">
                                <p>
                                    {{ card.description }}
                                </p>
                            </div>
