</template>

<script>
const LOAD_THRESHOLD_PX = 300

export default {
    data() {  
        return {
            activeSearch: false,
            products: [],
            result: [],
            search: '',
            loading: false,
            timeout: null
        }
    },

    methods: {
        async find(val) {
            if (!val || val === '' || !val.length) {
                this.loading = false
                this.result = this.products
            } else {
                this.loading = true
                this.result = this.products
                this.result = this.products.filter(ticker => ticker.title.toLowerCase().includes(this.search.toLowerCase()))
                this.loading = false
            }
        },

        selectItem(option) {
            this.$refs.input.value = option.title
        },

        handleScroll(e) {
            const { target } = e;

            const currentScroll = target.scrollTop;
            const scrollableDistance = Math.max(0, target.scrollHeight - target.offsetHeight);

            if (currentScroll >= scrollableDistance - LOAD_THRESHOLD_PX) {
                console.log('virtual');
            }
        }
    },

    async mounted () {
        const response = await fetch("https://dummyjson.com/products?limit=100")
        const { products: users } = await response.json()
        this.products = users
        this.result = this.products

        console.log(users)
    },

    watch: {
        search(val) {
            this.loading = true
            clearTimeout(this.timeout)
            this.timeout = setTimeout(() => {
                this.find(val)
            }, 500)
        },
    } 
}
</script>

